const url = 'https://countries-cities.p.rapidapi.com/location/country/US/city/list?page=2&per_page=20&population=1501';
const options = {
	method: 'GET',
	headers: {
		'X-RapidAPI-Key': 'cc0abd92femshf147bdb212c0658p109b7ejsn6d1a58066eb4',
		'X-RapidAPI-Host': 'countries-cities.p.rapidapi.com'
	}
};

try {
	const response = await fetch(url, options);
	const result = await response.text();
	console.log(result);
} catch (error) {
	console.error(error);
}
